
import { useState } from "react";
import "./App.css";

function App() {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [language, setLanguage] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    alert("Registered Successfully!");
  };

  const bookImages = {
   JavaScript: "https://m.media-amazon.com/images/I/91asIC1fRwL.jpg",
    Python: "data:image/jpeg;base64,",
    Java: "data:image/jpeg;base64,",
    C: "data:image/jpeg;base64,",
    Cpp: "data:image/jpeg;base64,"
  };

  return (
    <div className="wrapper">
        <div className="card small-card">
          <h2 className="title">Registration Form</h2>

          <form onSubmit={handleSubmit}>
            <input
              type="text"
              placeholder="Enter Your Name"
              value={name}
              onChange={(e) => setName(e.target.value)}
              className="input-box"
            />

            <input
              type="email"
              placeholder="Enter Your Email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              className="input-box"
            />

            <input
              type="password"
              placeholder="Enter Password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              className="input-box"
            />

            <select
              value={language}
              onChange={(e) => setLanguage(e.target.value)}
              className="input-box"
            >
              <option value="">Select Language</option>
              <option value="JavaScript">JavaScript</option>
              <option value="Python">Python</option>
              <option value="Java">Java</option>
              <option value="C">C Language</option>
              <option value="Cpp">C++ Language</option>
            </select>

            <button type="submit" className="btn">
              Register
            </button>
          </form>

          <div className="preview-card">
            <p><strong>Name:</strong> {name}</p>
            <p><strong>Email:</strong> {email}</p>
            <p><strong>Password:</strong> {password}</p>

            <p className="lang-preview">
              <strong>Language:</strong>

              {language && (
                <img
                  src={bookImages[language]}
                  alt="language icon"
                  className="small-preview-img inline-img"
                />
              )}

              {language}
            </p>
          </div>
        </div>

      </div>
  );
}

export default App;
